export const ADD_LOGIN_INFO = 'ADD_LOGIN_INFO';
export const REQUEST_CURRENCY = 'REQUEST_CURRENCY';
export const RECEIVE_CURRENCY = 'RECEIVE_CURRENCY';

export default function login(payload) {
  return {
    type: ADD_LOGIN_INFO,
    payload,
  };
}
